import { useEffect, useState } from "react";
import React  from "react";

export default function() {


    return(<div>
        <div id = 'login'>
            <img id="logo" alt = 'image' src={process.env.PUBLIC_URL + '/logo.png'}/>
            <p> Sign up to see photos and videos from your friends </p>
            <p> <input className='loginTextBox' type="text" placeholder="Email"/> </p>
            <p> <input className='loginTextBox' type="text" placeholder="Full Name"/> </p>
            <p> <input className='loginTextBox' type="text" placeholder="Username"/> </p>
            <p> <input className='loginTextBox' type="text" placeholder="Password"/> </p>
            <button id = 'loginButton'> Sign up </button>
        </div>
    </div>);
}
